import React from 'react';
import { NavLink } from 'react-router-dom';

const Menu = () => {
  return (
    <>
<NavLink exact className="active_nav" to="/">First Page</NavLink> &nbsp; &nbsp;
<NavLink exact className="active_nav" to="/second">Second Page</NavLink>
      
    </>
  )
}

export default Menu;
